[{"location":"","page":"Home","title":"Home","text":"CurrentModule = AoCElfTools","category":"page"},{"location":"#AoCElfTools","page":"Home","title":"AoCElfTools","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for AoCElfTools.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [AoCElfTools]","category":"page"},{"location":"#AoCElfTools.parse_input-Tuple{Int64}","page":"Home","title":"AoCElfTools.parse_input","text":"parse_input(i::Int) -> (IO -> puzzle input)\n\nReturns a function that parses Day i's puzzle input into a data structure that can then be used to find a solution.\n\nDesigned to be passed as a first argument to open.\n\nExamples\n\njulia> input = samplepath(1);\n\njulia> println(read(input, String))\n1000\n2000\n3000\n\n4000\n\n5000\n6000\n\n7000\n8000\n9000\n\n10000\n\njulia> open(parse_input(1), input)\n5-element Vector{Int64}:\n  6000\n  4000\n 11000\n 24000\n 10000\n\n\n\n\n\n","category":"method"},{"location":"#AoCElfTools.parse_solve-Tuple{Any}","page":"Home","title":"AoCElfTools.parse_solve","text":"parse_solve(i::Int) -> (IO -> solution)\n\nReturns a function that combines the parsing and solution steps for Day i.\n\nDesigned to be passed as a first argument to open.\n\nExamples\n\njulia> input = samplepath(1);\n\njulia> println(read(input, String))\n1000\n2000\n3000\n\n4000\n\n5000\n6000\n\n7000\n8000\n9000\n\n10000\n\njulia> open(parse_solve(1), input)\n(24000, 45000)\n\n\n\n\n\n","category":"method"},{"location":"#AoCElfTools.samplepath-Tuple{Int64}","page":"Home","title":"AoCElfTools.samplepath","text":"samplepath(i::Int) -> String\n\nReturn the path to the sample input file for Day i.\n\nExamples\n\njulia> samplepath(1)\n\"test/data/sample/01.txt\"\n\njulia> samplepath(14)\n\"test/data/sample/14.txt\"\n\n\n\n\n\n","category":"method"},{"location":"#AoCElfTools.solve-Tuple{Int64}","page":"Home","title":"AoCElfTools.solve","text":"solve(i::Int) -> (puzzle input -> solution)\n\nReturns a function that receive's Day i's puzzle input and returns a solution as a Tuple containing the two answers.\n\nExamples\n\njulia> input = open(parse_input(1), samplepath(1))\n5-element Vector{Int64}:\n  6000\n  4000\n 11000\n 24000\n 10000\n\njulia> solve(1)(input)\n(24000, 45000)\n\n\n\n\n\n","category":"method"},{"location":"#AoCElfTools.userpath-Tuple{Any, Int64}","page":"Home","title":"AoCElfTools.userpath","text":"userpath(user, i::Int) -> String\n\nReturn the path to user's input file for Day i.\n\nExamples\n\njulia> userpath(\"jbshannon\", 1)\n\"test/data/jbshannon/01.txt\"\n\njulia> userpath(\"jbshannon\", 13)\n\"test/data/jbshannon/13.txt\"\n\n\n\n\n\n","category":"method"}]
